#LINK PREDICTION
#calculating all the indexes
true={}
CN={}
JC={}
AAI={}
PA={}
flag=0
for i in G.nodes():
    for j in G.nodes():
        flag=flag+1
        if flag%10000==0:
            print("@",flag)
        if i != j and (not G.has_edge(i,j)) and (not (j,i) in CN):
            comm=set(G.neighbors(i)).intersection(G.neighbors(j))
            com=len(comm)
            CN[(i,j)]=com
            try:
                JC[(i,j)]=com/(G.degree(i)+G.degree(j)-com)
            except:
                JC[(i,j)]=0
            tem=0
            for k in comm:
                tem=tem+(1/math.log(G.degree(k)))
            AAI[(i,j)]=tem
            PA[(i,j)]=G.degree(i)*G.degree(j)  
            if [i,j] in to_remove or [j,i] in to_remove:
                true[(i,j)]=1
            else:
                true[(i,j)]=0


